import{_ as t,c as d,o as r,U as e}from"./chunks/framework.K-r7inPk.js";const l=JSON.parse('{"title":"组件清单（21-40）","description":"","frontmatter":{"title":"组件清单（21-40）","date":"2021-10-12T09:43:56.000Z"},"headers":[],"relativePath":"doc/wpdoc/组件清单（21-40）.md","filePath":"doc/wpdoc/组件清单（21-40）.md"}'),C={name:"doc/wpdoc/组件清单（21-40）.md"},a=e('<div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>组件清单（21-40）</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><table><thead><tr><th>序号</th><th>组件编码</th><th>组件名称</th><th>组件类型</th><th>所属行业</th><th>产品分类</th><th>应用端</th><th>应用客户</th><th>业务用途</th><th>设计人员</th></tr></thead><tbody><tr><td>21</td><td>COM-BC018-FC001</td><td>流程自定义审批人</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>APP</td><td>贤哥食品</td><td>支持申请人自己定义流程节点及审批人，每个申请每次提交的流程的审批节点都可以不一样，从而满足客户的个性化业务需求</td><td>陈壬询</td></tr><tr><td>22</td><td>COM-BC027-FC001</td><td>同批支持产品设置</td><td>功能组件</td><td>通用/通用组件</td><td>DMS</td><td>WEB</td><td>国台</td><td>支持设置各个产品的同批支持品，在经销商下采购订单时，根据下单的本品免费下已设置的同批支持产品</td><td>古凯炜</td></tr><tr><td>23</td><td>COM-BC010-FC001</td><td>照片墙功能</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>益海嘉里</td><td>以照片墙形式展示系统中采集提报的各类照片，支持按照照片类型、提交时间、门店类型等属性进行查询；支持导出图片，用图片转换工具转换</td><td>林泽南</td></tr><tr><td>24</td><td>COM-BC024-FC001</td><td>非规则表格列表的自定义导出</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>景兴</td><td>支持导出非规则表格，如合并行、合并列、设置行高、设置列宽、设置字体大小、颜色等</td><td>颜升</td></tr><tr><td>25</td><td>SP-YL-BC456-FC4562</td><td>预算编制(含调整)</td><td>业务和功能组件</td><td>食品行业/饮料</td><td>TPM</td><td>WEB</td><td>养元</td><td>编制企业的年度预算 1.预算编制维度：组织、品牌、科目、年-月 2.支持批量导入和手动新增的方式录入预算，确认发布后生效 3.支持批量导入和手动调整的方式调整预算，录入后直接生效 4.支持按照自然年和非自然年管理预算</td><td>梁洪铭</td></tr><tr><td>26</td><td>SP-YL-BC456-BC4563</td><td>预算调整记录</td><td>业务和功能组件</td><td>食品行业/饮料</td><td>TPM</td><td>WEB</td><td>养元</td><td>记录预算的调整记录，如预算调整编码、调整类型、变动前金额、变动后金额、本次变动金额、调整事由等</td><td>梁洪铭</td></tr><tr><td>27</td><td>COM-BC028-FC001</td><td>表格筛选数据置顶</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>APP</td><td>圣农</td><td>对表格进行筛选，已填写的数据不被清除，且已填写内容显示在表格最上方</td><td>梁焕</td></tr><tr><td>28</td><td>COM-BC026-FC001</td><td>钉钉流程对接</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>加多宝</td><td>对接钉钉官方审批流，并满足部分类型附件的在线预览，可用于预算，计划，活动，代垫，核销等审批功能中</td><td>李冲</td></tr><tr><td>29</td><td>COM-BC009-FC002</td><td>问卷调查2.0</td><td>功能组件</td><td>通用/通用组件</td><td>SFA</td><td>APP</td><td>好来化工</td><td>可自定义配置问卷，支持选择题（单选、多选、下拉框）、填空题（文本、小数、整数校验）、拍照等，通过数据库函数实现权限控制。操作流程：web端发布问卷，手机端填写问卷，后台查看问卷填报情况，支持导出答案到Excel（含图片）。</td><td>颜升/彭小锋</td></tr><tr><td>30</td><td>COM-BC025-FC001</td><td>电子签章对接</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>华美</td><td>用于针对客户对单据内容确认后生成带盖章的合同</td><td>陈桂芳</td></tr><tr><td>31</td><td>COM-BC023-FC001</td><td>小程序“今日”首页UI调整——以加多宝为例</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>小程序</td><td>加多宝</td><td>此组件在标准产品【今日首页】功能上进行了配置改造，由客户方的UI人员和我司实施同事，共同完成，页面展示内容包括：品牌宣传信息、通知公告、核心指标达情况（如销量、拓店）,且集成了核心功能入口，界面美观度及用户体验性都大大提升</td><td>杨荣</td></tr><tr><td>32</td><td>COM-BC029-FC001</td><td>外系统对接日志记录</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>国台</td><td>大部分项目都会涉及到和第三方系统的对接，如我们调用第三方系统的接口推送数据或获取数据，或者是第三方系统调用我们的接口推送数据或获取数据。此组件提供包含调用结果、异常信息、出参入参等数据，可以帮助我们快速地查找接口调用结果、复现问题。</td><td>古凯炜</td></tr><tr><td>33</td><td>COM-BC030-FC001</td><td>职位权限信息清单</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>益力多</td><td>在职位初始化过程中，需要导出系统中的【人员职位---菜单功能权限】的对应关系，用于分析职位权限划分是否合理，以便修正。而在现有系统的系统中，职位的权限只能在职位管理中进行一个个点开的查看，不能一次性看到全部的功能菜单权限设置，在整理职位功能清单的时候往往只能手工方式进行整理，不能进行导出。此组件支持查询职位对应的菜单功能权限，也可以进行直接的导出，减少实施人员或者系统管理员手动整理的时间，提高系统的使用效率</td><td>黄国荣</td></tr><tr><td>34</td><td>COM-BC031-FC001</td><td>导出图片改名及水印</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>养元</td><td>在现有项目中，很多项目需要通过工具导出图片存档或通过导出批量审核图片 (目前页面显示图片方式数据量比较小且为缩率图显示小导致审核效率低)。初始化产品中图片导出后图片名称为GUID，无具体业务含义无法快速分类和定位问题图片，此组件协助实施同事快速修改图片名称及水印提高系统价值</td><td>杜洋</td></tr><tr><td>35</td><td>COM-BC032-FC001</td><td>8系项目升级（如何实现数据库8.2升级到8.5）</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>全端</td><td>景兴</td><td>此组件适用于8.1、8.2版本升级8.5，详细说明了相关的整套流程，从结构比对、数据整理、IDE配置等都有详细说明，后续有其他项目有升级需要的可以直接参考此组件整理的方法和数据，从而缩短升级需要的时间</td><td>李深庭</td></tr><tr><td>36</td><td>SP-YL-BC463-FC4631</td><td>管理商超订单</td><td>业务和功能组件</td><td>食品行业/饮料</td><td>DMS</td><td>WEB</td><td>温氏乳业</td><td>用于下商超系统订单，支持一个系统订单内下多个门店订单，按照门店地址进行配送</td><td>吕海涛</td></tr><tr><td>37</td><td>SP-YL-BC417</td><td>积分管理</td><td>业务和功能组件</td><td>食品行业/饮料</td><td>SFA</td><td>WEB</td><td>养元</td><td>为激励DSR人员进行陈列活动的打造或者常规陈列的执行，企业通过积分的方式进行考核激励。此组件支持设置积分方案的投放规则，包括方案的投放范围、生效日期、积分规则等，积分指标目前仅包括“陈列执行合格”。</td><td>杜洋</td></tr></tbody></table>',2),s=[a];function o(n,c,h,i,_,p){return r(),d("div",null,s)}const M=t(C,[["render",o]]);export{l as __pageData,M as default};
